import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewPackages = () => {
  const [packages, setPackages] = useState([]);

  useEffect(() => {
    const fetchPackages = async () => {
      try {
        const response = await axios.get('http://localhost:8081/get-packages');
        setPackages(response.data);
      } catch (error) {
        console.error('Error fetching packages:', error);
      }
    };

    fetchPackages();
  }, []);

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this package?')) {
      try {
        await axios.delete(`http://localhost:8081/package/${id}`);
        setPackages((prevPackages) => prevPackages.filter((pkg) => pkg.id !== id));
        alert('Package deleted successfully!');
      } catch (error) {
        console.error('Error deleting package:', error);
        alert('Failed to delete package.');
      }
    }
  };

  const handleEdit = (id) => {
    console.log(`Edit package with ID: ${id}`);
    // Redirect to edit form or implement edit logic here.
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Packages</h1>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.th}>ID</th>
            <th style={styles.th}>Courier</th>
            <th style={styles.th}>Delivery Address</th>
            <th style={styles.th}>Pay on Delivery</th>
            <th style={styles.th}>Status</th>
            <th style={styles.th}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {packages.map((pkg) => (
            <tr key={pkg.id}>
              <td style={styles.td}>{pkg.id}</td>
              <td style={styles.td}>{pkg.courier?.name || 'N/A'}</td>
              <td style={styles.td}>{pkg.deliveryAddress}</td>
              <td style={styles.td}>{pkg.payOnDelivery ? 'Yes' : 'No'}</td>
              <td style={styles.td}>{pkg.status}</td>
              <td style={styles.td}>
                <button
                  style={styles.editButton}
                  onClick={() => handleEdit(pkg.id)}
                >
                  Edit
                </button>
                <button
                  style={styles.deleteButton}
                  onClick={() => handleDelete(pkg.id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '900px',
    margin: '50px auto',
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '10px',
    backgroundColor: '#f5e9e5',
  },
  title: {
    textAlign: 'center',
    color: '#d4849a',
    marginBottom: '20px',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  th: {
    border: '1px solid #ddd',
    padding: '10px',
    textAlign: 'left',
    backgroundColor: '#d4849a',
    color: '#fff',
  },
  td: {
    border: '1px solid #ddd',
    padding: '10px',
    textAlign: 'left',
  },
  editButton: {
    padding: '5px 10px',
    marginRight: '5px',
    backgroundColor: '#4CAF50',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  deleteButton: {
    padding: '5px 10px',
    backgroundColor: '#f44336',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default ViewPackages;
